import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import LoginPage from "./Pages/LoginPage.js";
import RegisterPage from "./Pages/RegisterPage.js";
import MainPage from "./Pages/MainPage.js";
import CreateTicket from "./Pages/CreateTicket.js"; 
import ListTicket from "./Pages/ListTickets.js";
import SupportDashboard from "./Pages/SupportDashboard.js";
import TicketDetailPage from "./Pages/TicketDetailPage.js";
import TicketDetails from "./Pages/TicketDetails.js";
import { AuthProvider } from "./context/AuthContext";
import Layout from "./Components/Layout";

import 'ag-grid-community/styles/ag-grid.css';
import 'ag-grid-community/styles/ag-theme-alpine.css';

function App() {
  return (
    <Router>
      <div className="App">
        <AuthProvider>
          <Routes>
            {/* layout gerektirmeyen sayfalar */}
            <Route path="/login" element={<LoginPage />} />
            <Route path="/register" element={<RegisterPage />} />

            {/* layout gerektiren sayfalar */}
            <Route element={<Layout />}>
              <Route path="/" element={<MainPage />} />
              <Route path="/tickets" element={<CreateTicket />} /> 
              <Route path="/ticket-list" element={<ListTicket />} />
              <Route path="/ticket/:ticketId" element={<TicketDetailPage />} />
              <Route path="/ticket-detail/:ticketId" element={<TicketDetails />} />
              <Route path="/support-dashboard" element={<SupportDashboard />} />
            </Route>
          </Routes>
        </AuthProvider>
      </div>
    </Router>
  );
}

export default App;
